import React from "react";
import "./Navbar.css";
import CartWidget from "./CartWidget";
import { Link } from "react-router-dom";
import { NavLink } from "react-router-dom";

const NavBar = () => {
    return (
        <header className="header">
        <Link to="/">
          <img className="logo" src="http://devshopu.com/assets/images/header_logo.svg" alt="Logo dev shop"></img>
        </Link>
            <div className="header-line"></div>

          <nav className="menu">
          <div className="containerNavBarCategory">
            <ul>
                <NavLink to="/category/3" className="nav-item nav-link tfont3" activeClassName="li_select">
                    <li className="menu-item">Monitores</li>
                </NavLink>
                <NavLink to="/category/1" className="nav-item nav-link tfont3" activeClassName="li_select">
                    <li className="menu-item">Teclados</li>
                </NavLink>
                <NavLink to="/category/2" className="nav-item nav-link tfont3" activeClassName="li_select">
                    <li className="menu-item">Mouses</li>
                </NavLink>
            </ul>
        </div>
          </nav>

        <div className="shoppingCartContainer">
            <Link to="/cart">
                <CartWidget className="icon-cart" />
            </Link>
        </div>
        </header>
    );
};

export default NavBar;
